<html><head><meta charset="utf8"><style type="text/css">

  body {
    display: flex;
    background-size: cover;
    font-family: sans-serif;
  }
  
  body.outline {
    margin: 10px;
    background: #eee;
    flex-wrap: wrap;
    align-content: flex-start;
  }
  
  body.show {
    margin: 0;
    background: #fff;
  }
  
  .outline slide {
    width: 10%;
    height: 10%;
    padding: 1em;
    margin: 10px;
    font-size: 0.2em;
  }
  
  .outline slide {
    box-shadow: 0px 0px 0px 0px #ccc;
  }
  
  .outline slide:hover {
    box-shadow: 0px 2px 0px 0px #ccc;
  }
  
  .outline slide.current {
    box-shadow: 0px 5px 0px 0px #999;
  }
  
  .show slide {
    width: 100%;
    height: 100%;

    display: none;
    font-size: 2em !important;
  }
  
  .show slide.current {
    display: flex;
  }
  
</style>
<style type="text/css">
@media print { 
  body {
    display: block !important;
  }

  slide {
    display: flex !important;
    page-break-after: always;
  }
}
</style>
<style type="text/css">
slide {
  display: flex;
  justify-content: center;
  align-items: center;
  background: white center center no-repeat;
  overflow: hidden;
  user-select:none;
  -webkit-user-select: none;
}

slide img {
  object-fit: contain;
  width: 80%;
  height: 80%;
}

slide code {
  white-space: pre;
}

slide iframe {
  border: none;
  width: 80%;
  height: 80%;

}

slide * {
  font-family: 'Amiri' !important;
  text-align: center;
}

slide * a {
  text-decoration: none;
  border-bottom: 1px dotted gray;
}

slide h1 {
  font-size: 5em;
  line-height: 0.9em;
  margin-bottom: 0.7em;
}

slide h2 {
  font-size: 3em;
  line-height: 1em;
  margin-bottom: 0.5em;
}

slide p {
  /*font-family: "Georgia", "Times New Roman", serif;*/
  color: black;
  font-size: 2.5em;
  line-height: 1em;
  max-width: 80%;
  max-height: 80%;
}

slide blockquote {
  border: none;
}

slide cite {
  margin-top: 1em;
  font-size: 1em;
}

slide code {
  font-family: Monaco, monospace !important;
}

slide sup {
  font-size: 0.5em;
  vertical-align: top;
  position: relative;
  top: -0.5em;
}

slide video {
  max-width: 80%;
  max-height: 80%;
  min-width: 80%;
  min-height: 80%;
}

/*slide *:last-child {
  margin-bottom: 0px;
}*/
</style><script type="text/javascript">
function deselectAll() {
  var currents = document.querySelectorAll(".current");
  [].forEach.call(currents, function(c) {
    c.removeAttribute("class");
  });
}

function select(element) {
  element.setAttribute("class", "current");
}

window.addEventListener("keydown", function(e) {
  var currents = document.querySelectorAll(".current");
  var lastCurrent = currents[currents.length - 1];
  var firstCurrent = currents[0];
  
  // right
  if(e.which == 39 && !e.altKey && !e.shiftKey) {
    deselectAll();
    select(lastCurrent ? (lastCurrent.nextElementSibling || lastCurrent.parentNode.firstElementChild) : document.querySelector("slide"));
    
  // left
  } else if(e.which == 37 && !e.altKey && !e.shiftKey) {
    deselectAll();
    select(firstCurrent ? (firstCurrent.previousElementSibling || firstCurrent.parentNode.lastElementChild) : document.querySelector("slide"));    
  }
});
